Currently territories are fixed functionality with an additional customProperties<String, Any> map for implementing external features: Territory { income: [DIAMOND], crops: [WHEAT, CARROT] animals: [PIG] ore: [DIAMOND, GOLD] customProperties: { manpower: 5, }
} An alternative would be to decompose territory resource properties as a set of TerritoryAttribute properites, similar to resources. The territory above would become: Territory { attributes: [ IncomeAttribute { [DIAMOND] } CropsAttribute { [WHEAT, CARROT] }, AnimalsAttribute { [PIG] }, OresAttribute { [DIAMOND, GOLD] }, ManpowerAttribute { 5 }, ]
} While this is more flexible, it incurs more development and runtime cost for checking which attributes exist in a territory. For my targeted use case, the majority of required territory functionality is just income, crops, animals, and ore. The flexibility in the above "Entity-Component" style of territory did not seem worth it.

105.body:
Territories in particular are intended to be swapped out in real time in order to easily modify resource attributes. e.g. Players build structures in their territory which rewards new resource node. To handle swapping out or modifying territories we have two options: Make territories fully mutable, modify or re-build resource properties in real time. Pros: "Non-invasive". Pointer stability. Cons: Need to enforce that only certain systems actually modify. Can potentially become difficult to enforce. Keep territories mostly immutable. Re-create entire territory when resources need to be updated. Pros: Systems cannot modify territory properties. Easier to reduce surface area for unknown state modifications (not guaranteed, but easier). References to object have stable properties (though not critical since codebase is currently single-threaded). Cons: Re-creating objects requires updating all pointer dependencies in other objects. More difficult to enforce memory safety. We opt for 2nd option of mainly immutable objects and re-creating the object when properties need to change. This architecture however makes holding direct references difficult since all these need to be updated when the object is re-created. This creates bigger surface area for memory leaks: Town { capital: Territory territories: ArrayList<Territory>
} Territory { owner: Town neighbors: List<Territory>
} If a territory is swapped out, all references to old Territory object must be replaced in the Town and Territory. The alternative representation is central storage of objects, while enforcing only handle references: TownId = int Town { capital: TerritoryId territories: ArrayList<TerritoryId>
} TerritoryId = int Territory { owner: TownId neighbors: List<TerritoryId>
} // central storages
towns = Map<TownId, Town>
territories = Map<TerritoryId, Territory>

