Rates for the same property are summed together. Properties are added together sequentially in order of priority (low to high) Multipliers are applied to properties that exist when it is applied. So in general, make resource nodes with multipliers separate and with higher priority value. Example: resources = { "iron": { "priority": 0, "ore": { "iron_ore": 0.5 } }, "gold": { "priority": 0, "ore": { "gold_ore": 0.5 } }, "diamond": { "priority": 100, "ore:" { "diamond_ore": 0.5 } }, "bonus_ore": { "priority": 50, "ore_total_multiplier": 1.5 }
} The sorted order will be ["iron", "gold", "bonus_ore", "diamond"] (from sorting by priority low to high). The territory resources is calculated as: Apply "iron": resources = { ore = { iron_ore: 0.5, }
} Apply "gold": resources = { ore = { iron_ore: 0.5, gold_ore: 0.5, }
} Apply "bonus_ore" (1.5x multipler on all ore): resources = { ore = { iron_ore: 0.75, gold_ore: 0.75, }
} Apply "diamond": resources = { ore = { iron_ore: 0.75, gold_ore: 0.75, diamond_ore: 0.5, }
}

