Resources are groups of "attribute" functions: A(T) -> T Resource nodes are composed of a list of ResourceAttribute interface objects. These are functions applied to a TerritoryResources to create a new TerritoryResources (e.g. to add resources, or apply modifiers). TerritoryResources { income: List<Item>, crops: List<Crop> animals: List<Animal>, ore: List<Item>, customProperties: Map<String, Any>,
} ResourceAttribute { apply(t: TerritoryResources) -> TerritoryResources
} ResourceNode { attributes: List<ResourceAttribute> priority: 69
} A single TerritoryResources's "compilation" process is shown below: Start with a blank TerritoryResources (or default properties). Sort a list of resource nodes by priority (e.g. so that modifiers like bonus ore percent is applied after base ore rates are added). Foreach resource node, foreach attribute, apply the attribute function to the TerritoryResources. t = TerritoryResources.default() resources = [ ResourceNode { [BonusOreAttribute], priority: 69 }, ResourceNode { [IncomeAttribute, OreAttribute], priority: 0 },
] for r in sort(resources, key = resource.priority()): for attribute in r.attributes: t = t.apply(attribute)

